import React from 'react';
import TableWidget from '../widgets/TableWidget'
import { getMaxListeners } from 'cluster';

function createData(name, age, phone, email, company, registeredevents=1) {
    return { name, age, phone, email, company, registeredevents };
  }
  
  const rows = [
    createData('Cupcake', 25, 123456789, "example@gmail.com", "spectrum Global",1),
    createData('Donut', 30, 123456789, "example@gmail.com", "spectrum Global", 2),
    createData('Eclair', 35, 123456789, "example@gmail.com", "spectrum Global",1),
    createData('Frozen yoghurt', 29, 123456789, "example@gmail.com", "spectrum Global",3),
    createData('Gingerbread', 35, 123456789, "example@gmail.com", "spectrum Global",4),
    createData('Honeycomb', 40, 123456789, "example@gmail.com", "spectrum Global",5),
    createData('Ice cream sandwich', 55, 123456789, "example@gmail.com", "spectrum Global",6),
    createData('Jelly Bean', 41, 123456789, "example@gmail.com", "spectrum Global",5),
    createData('KitKat', 42, 123456789, "example@gmail.com", "example@gmail.com",5),
    createData('Lollipop', 27, 123456789, "example@gmail.com", "spectrum Global",5),
    createData('Marshmallow', 31, 123456789, "example@gmail.com", "spectrum Global",5),
    createData('Nougat', 28, 123456789, "example@gmail.com", "spectrum Global",5),
    createData('Oreo', 29, 123456789, "example@gmail.com", "spectrum Global",5),
  ];

const columns = [
    { key_id: 'name', numeric: false, disablePadding: true, label: 'Name' },
    { key_id: 'age',  numeric: true, disablePadding: false, label: 'Age' },
    { key_id: 'phone', numeric: false, disablePadding: false, label: 'Phone' },
    { key_id: 'email', numeric: false, disablePadding: false, label: 'Email' },
    { key_id: 'company', numeric: false, disablePadding: false, label: 'Company' },
    { key_id: 'registeredevents', numeric: true, disablePadding: false, label: 'Registered Events'}
  ];

function Usertable(){
    const tableTitle="User List";
    return (
        <React.Fragment>
            <h1>User Table</h1>
            <TableWidget 
              rows={rows} 
              columns={columns}
              tableTitle={tableTitle}
            
            />
        </React.Fragment>
    );
}

export default Usertable;
